        },
        {
            value: 'UA',
            label: 'Ukraine'
        },
        {
            value: 'XK',
            label: 'Kosovo'
        },
        {
            value: 'BA',
            label: 'Bosnia and Herzegovina'
        },
        {
            value: 'CH',
            label: 'Switzerland'
        },
        {
            value: 'LI',
            label: 'Liechtenstein'
        },
        {
            value: 'NO',
            label: 'Norway'
        },
    ]

    return (
        <>
            <form>
                <TextInput
                    label={'Complex name'}
                    name={'complex_name'}
                    placeholder={'Complex name'}
                    className={'textInput_version001 p-medium'}
                    onChange={(e) => setComplexName(e.target.value)}
                />
                <TextInput
                    label={'Street'}
                    name={'street'}
                    placeholder={'Street'}
                    className={'textInput_version001 p-medium'}
                    onChange={(e) => setStreet(e.target.value)}
                />
                <NumberInput
                    label={'House number'}
                    name={'house_number'}
                    onChange={(e) => setHouseNumber(e.target.value)}
                />
                <TextInput
                    label={'House number extension'}
                    name={'house_number_extension'}
                    className={'textInput_version001 p-medium'}
                    onChange={(e) => setHouseNumberExtension(e.target.value)}
                />
                <TextInput
                    label={'City'}
                    name={'city'}
                    className={'textInput_version001 p-medium'}
                    onChange={(e) => setCity(e.target.value)}
                />
                <SelectInput
                    text={'Country'}
                    name={'country'}
                    items={country_ARRAY}
                    onChange={(e) => setCountry(e.target.value)}
                />
                <NumberInput
                    label={'Postal code'}
                    name={'postal_code'}
                    onChange={(e) => setPostalCode(e.target.value)}
                />
                <ValidButton
                    validButton_CLASSNAME={'validButton_CLASSNAME cursor-pointer'}
                    validButton_ID={'signup_VALIDBUTTON'}
                    span_text_CLASSNAME={'p-medium white_COLOR'}
                    validButton_TEXT={'Sign up'}
                    redirect_BOOLEAN={true}
                />
            </form>
        </>
    )
}

export default ComplexForm
